    # This is taken from: https://codereview.stackexchange.com/questions/232630/parsing-molecular-formula
    def parse_molecule(self, molecule):
        array = [[]]
        for token in re.findall('[A-Z][a-z]?|\d+|.', molecule):
            if token.isalpha() and token.istitle():
                last = [token]
                upper = token
                array[-1].append(token)
            elif token.isalpha():
                last = upper + token
                array[-1] = [last]
            elif token.isdecimal():
                count = int(token)
                array[-1].extend(last*(int(token)-1))
            elif token in '([{': # or token == '[':
                array.append([])
            elif token in ')]}': #or token == ']':
                last = array.pop()
                array[-1].extend(last)
            else:
                raise ValueError("Unrecognized character in molecule")
        return dict(Counter(array[-1]))

    def compositionedit(self):
        if self.ui.CmbChemical.currentIndex() == 0:
            self.composition = []
            self.elRate = []
            self.elName = []
            for key, value in self.parse_molecule(self.ui.LneChemicalFormula.text()).items():
                self.elName.append(key)
                self.elRate.append(float(value))

        if self.ui.CmbChemical.currentIndex() == 1:
            if self.ui.LneElements1.text() != self.previous_text:
                self.composition = []
                self.elName = []
                # Clear the old widgets
                for widget in self.added_widgets:
                    self.ui.frame_6.layout().removeWidget(widget)
                    widget.deleteLater()
                self.added_widgets = []

                for key, value in self.parse_molecule(self.ui.LneElements1.text()).items():
                    self.elName.append(key)
                    # Add corresponding label and line edit for each element
                    label = QLabel("Percentage of the element " + str(key) + " in the composition:")
                    label.setStyleSheet("QLabel { font: 9pt 'Ubuntu Regular'; color : white; }")
                    line_edit = QLineEdit()
                    line_edit.setObjectName("LneComposition" + str(key))
                    line_edit.setText("50")
                    # Create a double validator and set it for the line edit

                    double_validator = QDoubleValidator()
                    line_edit.setValidator(double_validator)

                    self.ui.frame_6.layout().addWidget(label)
                    self.ui.frame_6.layout().addWidget(line_edit)
                    # Convert percentage to float and add to composition list
                    self.composition.append(float(line_edit.text()) / 100)
                    # Add the widgets to the list
                    self.added_widgets.extend([label, line_edit])
                    line_edit.textChanged.connect(self.calc)
                    self.previous_text = self.ui.LneElements1.text()
            elif self.ui.LneElements1.text() == self.previous_text:
                self.composition = []
                self.elName = []
                for key, value in self.parse_molecule(self.ui.LneElements1.text()).items():
                    self.elName.append(key)
                    for widget in self.added_widgets:
                        if "LneComposition" in widget.objectName():
                            self.composition.append(float(widget.text()) / 100)
                self.composition = self.composition[:len(self.elName)]
               
        
        
    
