    def dataframe_to_table(self, table_widget, dataframe):
        table_widget.setRowCount(dataframe.shape[0])
        table_widget.setColumnCount(dataframe.shape[1])

        for i in range(dataframe.shape[0]):
            for j in range(dataframe.shape[1]):
                table_widget.setItem(i, j, QTableWidgetItem(str(dataframe.iat[i, j])))

        table_widget.setHorizontalHeaderLabels(dataframe.columns)
        table_widget.setVerticalHeaderLabels(dataframe.index.astype(str))

    def table_to_excel(self, table_widget, filename):
        data = []
        headers = [table_widget.horizontalHeaderItem(column).text() for column in range(table_widget.columnCount())]
        for row in range(table_widget.rowCount()):
            row_data = []
            for column in range(table_widget.columnCount()):
                item = table_widget.item(row, column)
                row_data.append(item.text() if item is not None else "")
            data.append(row_data)

        df = pd.DataFrame(data, columns=headers)

        df.to_excel(filename, index=False)

    def export_to_excel(self):
        options = QFileDialog.Options()
        options |= QFileDialog.DontUseNativeDialog
        filename, _ = QFileDialog.getSaveFileName(self, "Save File", "results", "Excel Files (*.xlsx);;All Files (*)", options=options)
        if filename:
            if not filename.endswith(".xlsx"):
                filename += ".xlsx"
            self.table_to_excel(self.ui.tableWidget_Results, filename)

